import React, { useContext } from 'react';
import { Context } from '../Context';
import Player from './Player';

const PlayerPanel = () => {
    const { players, setPlayers } = useContext(Context);

    const mappedPlayers = players ? players.map(player => <Player players={players} setPlayers={setPlayers} health={player.health} name={player.name} />) : null;

    return ( 
        <div className='player-panel'><div className="header"><h1>Players</h1></div>{mappedPlayers}</div>
     );
}

export default PlayerPanel;
